o":{"axis":"F_x/F_o","format":"toFixed(3)","label":"F_x/F_o","use":true},"G-J":{"axis":"G-J","format":"toFixed(3)","label":"G-J","use":true},"G-W2":{"axis":"G-W2","format":"toFixed(3)","label":"G-W2","use":true},"HR_h(ms)":{"axis":"HR_h(ms)","format":"toFixed(3)","label":"HR_h(ms)","use":true},"HR_hm":{"axis":"HR_hm","format":"toFixed(3)","label":"HR_hm","use":true},"HR_ms":{"axis":"HR_ms","format":"toFixed(3)","label":"HR_ms","use":true},"J-H":{"axis":"J-H","format":"toFixed(3)","label":"J-H","use":true},"J-W1":{"axis":"J-W1","format":"toFixed(3)","label":"J-W1","use":true},"M_G":{"axis":"M_G","format":"toFixed(3)","label":"M_G","use":true},"RP-K":{"axis":"RP-K","format":"toFixed(3)","label":"RP-K","use":true},"W1-W2":{"axis":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}},"derived_func_js":"\n\n    var color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n","derived_func_py":"\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n","derived_labels":["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"],"description_text":"&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;","features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"],"features_no_loglin":["G","BP","RP","J","H","K","W1","W2","W3","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2"],"flipped_axis":["M_G"],"format_js":" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var out2 = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n                \n        return out + out2\n    }\n","get_ref_link_js":"\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n\n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n","help_text":"\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    G-J \n    G-W2 \n    BP-H \n    BP-W3 \n    RP-K \n    J-H \n    J-W1 \n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n","hide_csv_etc_button":false,"hide_settings_panel":false,"hide_upload_button":false,"hover_table_names":{"F_b":"F_b","G":"G","HR_h(ms)":"HR_h(ms)","J":"J","W1":"W1","dec":"Decl.","name":"name","ra":"RA","ref":"ref"},"hover_table_names_json":"{\n    \"name\": \"name\",\n    \"ra\": \"RA\",\n    \"dec\": \"Decl.\",\n    \"F_b\": \"F_b\",\n    \"HR_h(ms)\": \"HR_h(ms)\",\n    \"G\": \"G\",\n    \"J\": \"J\",\n    \"W1\": \"W1\",\n    \"ref\": \"ref\"\n}","html_title":"CXO Training Dataset","include_version":true,"ini_visible_classes":["AGN","LM-STAR"],"ini_xy_text":["F_b","BP"],"last_changed_column":-1,"log_features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","F_x/F_o"],"non_features":["name","ra","dec","Class","ref"],"special_plot":{"P_inter":{"axis_label":"1/(1.001 - P_inter)","js":"\n\n        function plot_func_js(d) {\n\n            return d.map(x =&gt; 1 / (1.001 - x))\n\n        };\n    \n    ","log_axis_label":"-log(1.001 - P_inter)","py":"plot_func_py = lambda _ : 1 / (1.001 - _)"},"P_intra":{"axis_label":"1/(1.001 - P_intra)","js":"\n\n        function plot_func_js(d) {\n\n            return d.map(x =&gt; 1 / (1.001 - x))\n\n        };\n    \n    ","log_axis_label":"-log(1.001 - P_intra)","py":"plot_func_py = lambda _ : 1 / (1.001 - _)"}},"table_row1_labels":["name","ra","dec","Class","ref"],"table_row1_labels_active":["name","ra","dec","Class","ref"],"table_row2_labels":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"],"table_row2_labels_active":["F_b","HR_ms","HR_hm","HR_h(ms)","P_inter","P_intra","Signif.","G","J","W1","F_x/F_o"],"title_text":"X-ray and multiwavelength properties of classified sources from CSC v.2","use_cols":{"BPmag":{"axis":"BP (mag)","format":"toFixed(3)","label":"BP"},"Class":{},"Gmag":{"axis":"G (mag)","format":"toFixed(3)","label":"G"},"Hmag":{"axis":"H (mag)","format":"toFixed(3)","label":"H"},"Jmag":{"axis":"J (mag)","format":"toFixed(3)","label":"J"},"Kmag":{"axis":"K (mag)","format":"toFixed(3)","label":"K"},"RPmag":{"axis":"RP (mag)","format":"toFixed(3)","label":"RP"},"W1mag_comb":{"axis":"W1 (mag)","format":"toFixed(3)","label":"W1"},"W2mag_comb":{"axis":"W2 (mag)","format":"toFixed(3)","label":"W2"},"W3mag_allwise":{"axis":"W3 (mag)","format":"toFixed(3)","label":"W3"},"dec_cat":{"format":"toFixed(8)","label":"dec"},"flux_aper90_ave_b":{"axis":"F_b (erg/s/cm^2)","format":"toExponential(3)","label":"F_b"},"flux_aper90_ave_h":{"axis":"F_h (erg/s/cm^2)","format":"toExponential(3)","label":"F_h"},"flux_aper90_ave_m":{"axis":"F_m (erg/s/cm^2)","format":"toExponential(3)","label":"F_m"},"flux_aper90_ave_s":{"axis":"F_s (erg/s/cm^2)","format":"toExponential(3)","label":"F_s"},"kp_intra_prob_b":{"axis":"1 / (1.001 - P_intra)","format":"toFixed(3)","label":"P_intra"},"name_cat":{"label":"name"},"ra_cat":{"format":"toFixed(8)","label":"ra"},"ref":{},"rgeo":{"format":"toFixed(3)"},"significance":{"axis":"Signif. (\u03c3)","format":"toFixed(3)","label":"Signif."},"var_inter_prob_b":{"axis":"1 / (1.001 - P_inter)","format":"toFixed(3)","label":"P_inter"}},"use_raw_cols_list":["name_cat","ra_cat","dec_cat","Class","ref","flux_aper90_ave_b","flux_aper90_ave_h","flux_aper90_ave_m","flux_aper90_ave_s","var_inter_prob_b","kp_intra_prob_b","significance","Gmag","BPmag","RPmag","Jmag","Hmag","Kmag","W1mag_comb","W2mag_comb","W3mag_allwise","rgeo"],"webpage_name":"index.html"},"sel_x":{"id":"2498"},"sel_y":{"id":"2499"},"sources":{"AGN":{"id":"2206"},"CV":{"id":"2226"},"HM-STAR":{"id":"2248"},"HMXB":{"id":"2272"},"LM-STAR":{"id":"2298"},"LMXB":{"id":"2326"},"NS":{"id":"2356"},"YSO":{"id":"2388"},"custom":{"id":"2422"}},"unclass":{"id":"2485"},"upload_button":{"id":"3554"}},"code":"\n\n        //upload_button.disabled = false\n\n        'use strict'\n\n        function csvToArray(text) {\n            let p = '', row = [''], ret = [row], i = 0, r = 0, s = !0, l;\n            for (l of text) {\n                if ('\"' === l) {\n                    if (s &amp;&amp; l === p) row[i] += l;\n                    s = !s;\n                } \n                else if (',' === l &amp;&amp; s) \n                    l = row[++i] = '';\n                else if ('\\n' === l &amp;&amp; s) {\n                    if ('\\r' === p) row[i] = row[i].slice(0, -1);\n                    row = ret[++r] = [l = '']; \n                    i = 0;\n                } \n                else row[i] += l;\n                p = l;\n            }\n            return ret;\n        }\n        \n        let obj = csvToArray(atob(this.value).trim())\n\n        let len = obj.length - 1\n\n        //transpose\n        obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n\n        let df_custom = {}\n        \n        // !!!\n        \n        for (var ob of obj) {\n        \n            let name = ob[0]\n        \n            if (!(name in all_dict)) {\n            \n                if (name in q['all']) \n                        \n                    name = q['all'][name]['label'] \n                                      \n                else continue\n                                        \n            } \n\n            let sl = ob.slice(1)\n            \n            if (name in all_dict)             \n                if (all_dict[name]['format'].match(/to/) != null)\n                    sl = sl.map(parseFloat)\n\n            df_custom[name] = sl    \n        }\n        \n            \n        function replace_from_dict(arr, dic) {\n\n            var out = [];\n            \n            for (var i=0; i&lt;arr.length; i++) {\n            \n                 var cl = arr[i];\n                 \n                 if (cl in dic)                \n                     out.push(dic[cl])\n                 else    \n                     out.push(cl)\n                       \n            }\n            \n            return out\n            \n         }   \n         \n         df_custom[q['class_column']] = replace_from_dict(df_custom[q['class_column']], q['classes_dict']) \n \n\n        \n\n    var color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n\n\n        var feat_x = features[sel_x.active]\n        var feat_y = features[sel_y.active]\n\n        if (log_source.data[feat_x][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['x'] = df_custom[feat_x]\n        }         \n \n        if (log_source.data[feat_y][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', ll)\n                  str2 = col2enc[str2]\n\n              return str2\n\n          }\n          let s = String(x);\n          return s.replace(test, convert);\n        }\n\n        if (expression=='') return\n\n        expression = l2c(expression, regex)\n\n        //const match = [...expression.matchAll(regex)]    \n\n        var func = compileExpression(expression, additionalFunctions)\n\n        var kls = [...classes, 'custom']\n\n        for (var klas of kls) {\n\n            var inds = []\n\n            for (var i=0; i &lt; sources[klas].length; i++) {\n\n                var row = {}\n\n                for (var k in sources[klas].data)                          \n                    row[col2enc[k]] = sources[klas].data[k][i]    \n\n                if (func(row) == 1) inds.push(i)\n\n            }\n\n            sources[klas].selected.indices = inds   \n\n            sources[klas].change.emit()\n\n        }\n\n        table_mode.active = 2\n\n    "},"id":"3578","type":"CustomJS"},{"attributes":{"disabled":true,"margin":[0,0,0,0],"name":"Flag_gaiadist_row","value":"Flag_gaiadist","width":150},"id":"2047","type":"TextInput"},{"attributes":{"args":{"all_dict":{"BP":{"axis":"BP (mag)","format":"toFixed(3)","label":"BP"},"BP-H":{"axis":"BP-H","format":"toFixed(3)","label":"BP-H","use":true},"BP-W3":{"axis":"BP-W3","format":"toFixed(3)","label":"BP-W3","use":true},"Class":{"axis":"Class","format":"","label":"Class"},"F_b":{"axis":"F_b (erg/s/cm^2)","format":"toExponential(3)","label":"F_b"},"F_h":{"axis":"F_h (erg/s/cm^2)","format":"toExponential(3)","label":"F_h"},"F_m":{"axis":"F_m (erg/s/cm^2)","format":"toExponential(3)","label":"F_m"},"F_s":{"axis":"F_s (erg/s/cm^2)","format":"toExponential(3)","label":"F_s"},"F_x/F_o":{"axis":"F_x/F_o","format":"toFixed(3)","label":"F_x/F_o","use":true},"G":{"axis":"G (mag)","format":"toFixed(3)","label":"G"},"G-J":{"axis":"G-J","format":"toFixed(3)","label":"G-J","use":true},"G-W2":{"axis":"G-W2","format":"toFixed(3)","label" t=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n\n\n        //var table_html = '&lt;table id=\"my_datatable\" class=\"display\" style=\"width:100%;background-color:rgba(66, 165, 245, 0.2);\"&gt;&lt;thead&gt;&lt;tr&gt;&lt;style&gt;    td.details-control {        background: url(details_open.png) no-repeat center center;        cursor: pointer;    }    tr.shown td.details-control {        background: url(details_close.png) no-repeat center center;    }    table#my_datatable.dataTable tbody:hover {      background-color: rgba(66, 165, 245, 0.2);    }    &lt;/style&gt;'\n\n        //var table_html = '&lt;table id=\"my_datatable\" class=\"table table-striped\" style=\"width:100%;\"&gt;&lt;thead&gt;&lt;tr&gt;'\n\n        var table_html = '&lt;table id=\"my_datatable\" class=\"display\" style=\"width:100%;\"&gt;&lt;thead&gt;&lt;tr&gt;'\n\n        table_html += '&lt;th&gt;&lt;/th&gt;'\n\n        for (var k of cols) \n            table_html += '&lt;th&gt;'+col2lab[k]+'&lt;/th&gt;'\n\n        table_html += '&lt;/tr&gt;&lt;/thead&gt;&lt;tbody&gt;'\n\n        for (var i=0; i&lt;n; i++) {\n\n            table_html += '&lt;tr id=\"id' + i + '\"&gt;' \n\n            table_html += '&lt;td&gt;&lt;/td&gt;' \n\n            for (var k of cols) {\n\n                var f = all_dict[k]['format']\n                \n                if (['ref'].includes(k)) {\n                                        \n                    var v = Boolean(z[k][i]) ? get_ref_link(z[k][i])[1] : '&lt;a href=\"\" target=\"_blank\"&gt;&lt;/a&gt;'    \n                    \n                    table_html += '&lt;td&gt;' + v + '&lt;/td&gt;'                     \n                    \n                }\n\n                else if (typeof z[k][i]==='number' &amp;&amp; f.match(/to/) != null) {\n\n                    const regex = /\\d+/\n                    const dig = Number(f.match(regex)[0])\n\n                    if (f.match(/toE/) != null)            \n _G","use":true},"RP-K":{"axis":"RP-K","format":"toFixed(3)","label":"RP-K","use":true},"W1-W2":{"axis":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}},"derived_func_js":"\n\n    var color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n","derived_func_py":"\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n","derived_labels":["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"],"description_text":"&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;","features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"],"features_no_loglin":["G","BP","RP","J","H","K","W1","W2","W3","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2"],"flipped_axis":["M_G"],"format_js":" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var out2 = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n                \n        return out + out2\n    }\n","get_ref_link_js":"\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n\n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n","help_text":"\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    G-J \n    G-W2 \n    BP-H \n    BP-W3 \n    RP-K \n    J-H \n    J-W1 \n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n","hide_csv_etc_button":false,"hide_settings_panel":false,"hide_upload_button":false,"hover_table_names":{"F_b":"F_b","G":"G","HR_h(ms)":"HR_h(ms)","J":"J","W1":"W1","dec":"Decl.","name":"name","ra":"RA","ref":"ref"},"hover_table_names_json":"{\n    \"name\": \"name\",\n    \"ra\": \"RA\",\n    \"dec\": \"Decl.\",\n    \"F_b\": \"F_b\",\n    \"HR_h(ms)\": \"HR_h(ms)\",\n    \"G\": \"G\",\n    \"J\": \"J\",\n    \"W1\": \"W1\",\n    \"ref\": \"ref\"\n}","html_title":"CXO Training Dataset","include_version":true,"ini_visible_classes":["AGN","LM-STAR"],"ini_xy_text":["F_b","BP"],"last_changed_column":-1,"log_features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","F_x/F_o"],"non_features":["name","ra","dec","Class","ref"],"special_plot":{"P_inter":{"axis_label":"1/(1.001 - P_inter)","js":"\n\n        function plot_func_js(d) {\n\n            return d.map(x =&gt; 1 / (1.001 - x))\n\n        };\n    \n    ","log_axis_label":"-log(1.001 - P_inter)","py":"plot_func_py = lambda _ : 1 / (1.001 - _)"},"P_intra":{"axis_label":"1/(1.001 - P_intra)","js":"\n\n        function plot_func_js(d) {\n\n            return d.map(x =&gt; 1 / (1.001 - x))\n\n        };\n    \n    ","log_axis_label":"-log(1.001 - P_intra)","py":"plot_func_py = lambda _ : 1 / (1.001 - _)"}},"table_row1_labels":["name","ra","dec","Class","ref"],"table_row1_labels_active":["name","ra","dec","Class","ref"],"table_row2_labels":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1" cts, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    G-J \n    G-W2 \n    BP-H \n    BP-W3 \n    RP-K \n    J-H \n    J-W1 \n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n    "},"id":"3550","type":"Div"},{"attributes":{"background":"pink","js_property_callbacks":{"change:value":[{"id":"1419"}]},"margin":[0,0,0,0],"name":"[sep,axis]","value":"sep","width":150},"id":"1418","type":"TextInput"},{"attributes":{"style":{"font-size":"150%"},"text":"&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;","width":1000},"id":"3296","type":"Div"},{"attributes":{"text":"&lt;a href=\"https://hits.seeyoufarm.com\"&gt;&lt;img src=\"https://hits.seeyoufarm.com/api/count/incr/badge.svg?url=https%3A%2F%2Fhome.gwu.edu%2F%7Ekargaltsev%2FXCLASS%2F&amp;count_bg=%2379C83D&amp;title_bg=%23555555&amp;icon=&amp;icon_color=%23E7E7E7&amp;title=hits&amp;edge_flat=false\"/&gt;&lt;/a&gt;"},"id":"3300","type":"Div"},{"attributes":{"args":{"df_source":{"id":"1014"},"k":"label","q_mod":{"id":"1003"},"q_orig":{"id":"1002"},"r":"sep","radio_rows":[{"id":"1021"},{"id":"1050"},{"i J-H', 'J-W1', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n","width":1000},"id":"1106","type":"TextAreaInput"},{"attributes":{"args":{"feat":"derived","k":"label","q_modified_source":{"id":"1003"},"r":"HR_h(ms)"},"code":"\n    \n        q_modified_source.data[feat][0][r][k] = cb_obj.value\n        \n    "},"id":"1134","type":"CustomJS"},{"attributes":{"children":[{"id":"1751"},{"id":"1752"},{"id":"1754"},{"id":"1756"}]},"id":"1758","type":"Row"},{"attributes":{"args":{"df_source":{"id":"1014"},"k":"label","q_mod":{"id":"1003"},"q_orig":{"id":"1002"},"r":"Hmag","radio_rows":[{"id":"1021"},{"id":"1050"},{"id":"1047"}],"w_misc_rows":[{"id":"1027"},{"id":"1031"},{"id":"1035"},{"id":"1039"},{"id":"1043"},{"id":"1054"},{"id":"1058"}],"warn":{"id":"1336"}},"code":"\n    \n        //var rnd = 'change_text' + Math.random()    \n        //console.time(rnd)\n\n        var old_label = q_mod.data['all'][0][r]['label'] \n        \n        if (r==q_mod.data['class_column'][0])         \n            q_mod.data['class_column'][0] = cb_obj.value\n            \n        if (r==q_orig.data['class_column'][0])             \n            q_orig.data['class_column'][0] = cb_obj.value  \n                                \n        q_mod.data['all'][0][r][k] = cb_obj.value\n        \n        var data = df_source.data\n        \n        data[cb_obj.value] = data[old_label]\n        \n        delete data[old_label]\n        \n        df_source.data = data\n        \n        if (k != 'label') return\n        \n        q_mod.data['last_changed_column'][0] = r\n                        \n        for (var model of [...w_misc_rows, ...radio_rows]) { \n        \n            var model_labels = []\n            for (var lab of m s":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}}],"derived_func_js":["\n\n    var color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n"],"derived_func_py":["\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n"],"derived_labels":[["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"]],"description_text":["&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;"],"features":[["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"]],"features_no_loglin":[["G","BP","RP","J","H","K","W1","W2","W3","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2"]],"flipped_axis":[["M_G"]],"format_js":[" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.d true},"HR_ms":{"axis":"HR_ms","format":"toFixed(3)","label":"HR_ms","use":true},"J-H":{"axis":"J-H","format":"toFixed(3)","label":"J-H","use":true},"J-W1":{"axis":"J-W1","format":"toFixed(3)","label":"J-W1","use":true},"M_G":{"axis":"M_G","format":"toFixed(3)","label":"M_G","use":true},"RP-K":{"axis":"RP-K","format":"toFixed(3)","label":"RP-K","use":true},"W1-W2":{"axis":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}}],"derived_func_js":["\n\n    var color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n"],"derived_func_py":["\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['G-J', 'G-W2', 'BP-H', 'BP-W3', 'RP-K', 'J-H', 'J-W1', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n"],"derived_labels":[["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"]],"description_text":["&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;"],"features":[["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2","M_G"]],"features_no_loglin":[["G","BP","RP","J","H","K","W1","W2","W3","G-J","G-W2","BP-H","BP-W3","RP-K","J-H","J-W1","W1-W2"]],"flipped_axis":[["M_G"]],"format_js":[" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n
